import './App.css';
import RandomCatThings from './RandomCatThings';
import SavedCatThings from './SavedCatThings';
import {Route} from 'react-router-dom'

function App() {
  return (
    //<Routeexactpath="/"><Home /></Route><Routepath="/news"><NewsFeed /></Route>
    <div className="App">
      <Route exactpath="/">
        <RandomCatThings />
      </Route>
      <Route exactpath="/saved">    
        <SavedCatThings/>
      </Route>
    </div>
  );
}
export default App;
